import React from 'react';
import Select from 'react-select';
import { Genders } from './menus/options'; // Import the 'Genders' variable from options.js
import './DropdownStyles.css'; // Import your CSS file

const GenderDropdown = ({ onSelectGender }) => {
    return (
        <div className="dropdown-container">
            <label className="dropdown-label">Select Gender</label>
            <Select options={Genders} onChange={(e) => onSelectGender(e.value)} /> {/* Use 'Genders' directly */}
        </div>
    );
};

export default GenderDropdown;
